import React from 'react';

class Form extends React.Component {
    render() {
        return (
            <form onSubmit={this.props.getCoord} style={{textAlign: "center"}}>
                <input type="text" name="city" placeholder="location..." style={{padding: "12px 20px"}}></input>
                <button style={{padding: "12px 20px"}}>Search</button>
            </form>
        )
    }
}

export default Form;
